import React, {Component} from 'react';
import './App.css';
import { render } from '@testing-library/react';
class Menubar extends Component{
  render(){
    return(
    <ul className="menu">
        <li>
            <a href="#none" className="first">1페이지</a>
        </li>
        <li>
            <a href="#" className="second">2페이지</a>
        </li>
        <li>
            <a href="#" className="third">3페이지</a>
        </li>
        <li>
            <a href="#" className="fourth">4페이지</a>
        </li>
    </ul>
    );
  }
}
class App extends Component{
  render(){
    return(
      <div>
        <Menubar></Menubar>
      </div>
    );
  }
}

export default App;
